import React from "react";

const Capsules = (props) => {
  return (
    // <div className="card ">
    <div className="card my-2 bg-dark text-light" style={{ width: "300px", maxHeight:"500px",height: "400px"}}>
      <div className="card-body">
        <h5 className="card-title">
          <strong>{props.type}</strong>:{props.capsule_serial}
        </h5>
        <p
          className={
            props.status === "active"
              ? "text-success card-text"
              : "text-danger card-text"
          }
        >
         <strong className="text-light">Status</strong> {props.status}

        </p>
        <article>
          <ul className="list-group bg-dark  text-light">
            <li className = "list-group-item bg-dark  text-light">landing:{props.landings}</li>
            <li className="list-group-item bg-dark  text-light">landing:{props.name}</li>
            <li className="list-group-item bg-dark  text-light">reused :{props.reuse_count}</li>
            <li className="list-group-item bg-dark  text-light">{props.details}</li>
            <li className="list-group-item bg-dark  text-light">{props.original_launch}</li>
          </ul>
        {/* <p className="card-text">landing:{props.landings}</p>
        <p className="card-text">landing:{props.name}</p>
        <p className="card-text">reused :{props.reuse_count} times</p>
        <p className="card-text">{props.details}</p>
        <p className="card-text">{props.original_launch}</p> */}
        </article>
      </div>
    </div>
  );
};

export default Capsules;
